webpackJsonp([1247],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-arrayprototypeindexof.json":function(e,r){e.exports={data:{markdownRemark:{html:"<p>The <code>indexOf()</code> method returns the first index at which a given element can be found in the array, or -1 if it is not present!!</p>\n<pre><code>arr.indexOf(searchElement[, fromIndex = 0])\n</code></pre>\n<h2>Parameters</h2>\n<pre><code>     | Parameter\n</code></pre>\n<p>-------- | -------------<br>\nRequired | Arr<br>\nRequired | searchElement<br>\nOptional | fromIndex</p>\n<p><strong>Return:</strong> -1 if the element is not found in the array or an integer >=0, the position of the element in the array</p>\n<p><a href=\"https://developer.mozilla.org/en/docs/Web/JavaScript/Reference/Global_Objects/Array/indexOf\">MDN link</a></p>\n<h2>Examples</h2>\n<p><strong>Use Case:</strong> Check to see if there are any apples in the fruit basket (defined as an array)?</p>\n<pre><code>var basket = ['apple','orange','banana','strawberry'];\n</code></pre>\n<p><strong>Without</strong> indexOf()</p>\n<pre><code>var found = false;\nfor(var i= 0, l = basket.length; i&#x3C; l; i++){\n    if(basket[i] === 'apple'){\n        found = true;\n                break;\n    }\n}\nconsole.log(found);\n</code></pre>\n<p><strong>With</strong> indexOf()</p>\n<pre><code>console.log(basket.indexOf(\"apple\") != -1);\n</code></pre>",frontmatter:{title:"Array.prototype.indexOf",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-arrayprototypeindexof/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-arrayprototypeindexof/"}}}});
